import React from "react";
import { TwitterTimelineEmbed } from "react-twitter-embed";
import InstagramEmbed from "react-instagram-embed";

const News = () => {
  return (
    <section className="news py-5">
      <div className="container">
        <h2 className="heading-secondary u-margin-bottom ">أخبارنا</h2>
        <div className="row">
          <div className="">
          <TwitterTimelineEmbed
          sourceType="profile"
          screenName="saradiqsa"
          options={{
            tweetLimit: "5",
            width: "100%",
            height: "100%"
          }}
          theme="dark"
          noHeader="true"
          noBorders="true"
          noFooter="true"
        ></TwitterTimelineEmbed>
          </div>
          <div className="">
            <InstagramEmbed
              url="https://www.instagram.com/p/CAjaTJAjpUn/?utm_source=ig_web_copy_link"
              maxWidth={320}
              hideCaption={false}
              containerTagName="div"
              protocol=""
              injectScript
              onLoading={() => {}}
              onSuccess={() => {}}
              onAfterRender={() => {}}
              onFailure={() => {}}
            />
          </div>
        </div>
      </div>
    </section>
  );
};

export default News;
